pragma solidity ^0.5.0;

import "./@openzeppelin/contracts/access/Roles.sol";
import "./@openzeppelin/contracts/token/ERC20/ERC20Fee.sol";

contract StableCoin is ERC20Fee {
    using Roles for Roles.Role;

    Roles.Role private _minters;
    Roles.Role private _burners;

    event MinterAdded(address indexed account);
    event MinterRemoved(address indexed account);

    event BurnerAdded(address indexed account);
    event BurnerRemoved(address indexed account);

    modifier onlyMinter() {
        require(
            isMinter(_msgSender()),
            "MinterRole: caller does not have the Minter role"
        );
        _;
    }

    modifier onlyBurner() {
        require(
            isBurner(_msgSender()),
            "BurnerRole: caller does not have the Burner role"
        );
        _;
    }

    constructor(string memory name, string memory symbol, uint8 decimals)
        public
        ERC20Fee(name, symbol, decimals)
    {
        _addMinter(_msgSender());
        _addBurner(_msgSender());
    }

    function isMinter(address account) public view returns (bool) {
        return _minters.has(account);
    }

    function isBurner(address account) public view returns (bool) {
        return _burners.has(account);
    }

    function addMinter(address account) public onlyOwner {
        _addMinter(account);
    }

    function addBurner(address account) public onlyOwner {
        _addBurner(account);
    }

    function renounceMinter() public {
        _removeMinter(_msgSender());
    }

    function renounceBurner() public {
        _removeBurner(_msgSender());
    }

    function _addMinter(address account) internal {
        _minters.add(account);
        emit MinterAdded(account);
    }

    function _addBurner(address account) internal {
        _burners.add(account);
        emit BurnerAdded(account);
    }

    function _removeMinter(address account) internal {
        _minters.remove(account);
        emit MinterRemoved(account);
    }

    function _removeBurner(address account) internal {
        _burners.remove(account);
        emit BurnerRemoved(account);
    }

    /**
        * @dev See {ERC20-_mint}.
        *
        * Requirements:
        *
        * - the caller must have the {MinterRole}.
        */
    function mint(address to, uint256 amount) public onlyMinter returns (bool) {
        _mint(to, amount);
        return true;
    }

    /**
        * @dev Destroys `amount` tokens from the caller.
        *
        * Requirements:
        *
        * - the caller must have the {BurnerRole}.
        */
    function burn(uint256 amount) public onlyBurner returns (bool) {
        _burn(_msgSender(), amount);
    }
}

